literals:
color: white;
  text-align: center;
  font-size: 50px;
  font-family: Arial, Helvetica, sans-serif;

margin-top: 60px;
  background-color: white;
  border-radius: 40px;
  height: 50vh;
  display: grid;
  grid-template-columns: 1fr 1fr;
  justify-content: center;
  align-items: center;
  box-shadow: -20px -10px 53px 2px black;
  padding: 20px;
  @media (max-width: 750px) {
    grid-template-columns: 1fr;
    height: auto;

      }
